        <Grid container spacing={3}>
          <Grid item xs={3} md={6} lg={12}>
            <Projects2 />
          </Grid>
          <Grid
            style={{
              marginLeft: 200,
              marginTop: 50,
              marginBottom: 50,
              fontWeight: "bold",
              fontSize: "25px",
            }}
          >
            [허병규] 님의 등급은 00 등급 입니다.
          </Grid>
        </Grid>
      </MDBox>
      <Footer />
    </DashboardLayout>
  );
}

export default Simulation;
